import React from 'react';
// import './App.css';
import Card from './Card'

function Deck(props) {
  let deck = props.deck.map((cards) => {
    return <Card key={cards.value}/>
  })
  return (
    <div className="App">
     {/* <h1> Welcome to Bagjav!</h1> */}

     <p>{deck}</p>
    </div>
  );
}

export default Deck;
